import { Route, BrowserRouter as Router, Switch } from "react-router-dom";

import { MembersPage } from "./frontend-page/team-page/MembersPage";
import React from "react";
import { TeamPage } from "./frontend-page/team-page/TeamPage";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path='/' component={TeamPage} />
        <Route exact path='/members' component={MembersPage} />
      </Switch>
    </Router>
  );
}

export default App;
